INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 1, 1, 'und', 0, 'Helloooo! \r\n\r\nThis is an awesome test for my very first time here in DRUPAL 7!\r\n\r\nI\'m so stocked, waaauw! ', '', 'filtered_html'),
('node', 'page', 0, 2, 2, 'und', 0, 'This is my very first page!\r\nHow awesome is this? \r\nCrazy! \r\n\r\nwaauw!', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, 'Als u moeite heeft om dit te lezen omdat u te beneveld bent door champagne, is de kans groot dat u de gelukkige Belg bent die de Euromillions-jackpot van 168 miljoen gewonnen heeft. Al is dat twijfelachtig, want wij kennen de winnaar eigenlijk al.', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, 'Het is geen geheim dat elke minister binnenkort zal moeten snijden in zijn of haar budget. Dus ook minister van Volksgezondheid Maggie De Block. Aanstormend journalistiek talent Charlotte Timmers ging voor \'Nu Terzake\' met haar praten - al blijft dat verduivelde verleden als Ketnetpresentator haar grondig parten spelen.', '', 'filtered_html'),
('node', 'article', 0, 5, 5, 'und', 0, 'De presidentsverkiezingen in Amerika komen zienderogen dichterbij - dat is zo met gebeurtenissen in de toekomst. Eén van de speerpunten van de campagne van Donald Trump is een grote muur bouwen op de grens tussen Mexico en de Verenigde Staten. Maar volgens goeie bronnen - we noemen geen namen, maar weten het van sterreporter Luc Haekens - zijn er ook plannen om een muur op het strand van Miami, Florida te zetten.', '', 'filtered_html'),
('node', 'article', 0, 6, 6, 'und', 0, '#INGing is de nieuwste internetrage. Neem je smartphone, film hoe je iemand ermee pijn doet, en zet het filmpje online met de hashtag #INGing. Zo betuigen jij én je slachtoffer hun solidariteit met de ING-werknemers.\r\n\r\nMaar het wordt nog beter! Vanaf heden is er INGing GO, het lang geanticipeerde spel rond INGing. Alles wat je moet weten, staat in de spelregels!', '', 'filtered_html'),
('node', 'article', 0, 7, 7, 'und', 0, 'In het heetst van de onderhandelingen over de begrotingen verliet vicepremier Kris Peeters gisteravond de onderhandelingstafel, om daarna niet meer terug te keren. Een moeilijk politiek spel, dat een uitleg op niveau vereist.', '', 'filtered_html'),
('node', 'article', 0, 8, 8, 'und', 0, 'De wereldvoetbalbond FIFA is aangeklaagd voor uitbuiting van arbeiders in Qatar. Bij de voorbereidingen van het WK voetbal in 2022 zijn naar schatting al honderden werknemers omgekomen. FIFA zegt nochtans altijd duidelijk geweest te zijn in de communicatie over het WK 2022.', '', 'filtered_html'),
('node', 'article', 0, 9, 9, 'und', 0, 'Brusselaars moeten 100 miljoen euro groenestroomsubsidies betalen voor een vervuilende en verouderde afvalverbrandingsoven. Dat lijkt louche, maar gelukkig is Didier van de Hobbyhoek er om het volk alles te laten slikken, met een leuk strotrammertje.', '', 'filtered_html'),
('node', 'article', 0, 10, 10, 'und', 0, 'De Vrijdaggroep, een denktank van 25- tot 35-jarigen, stelt één jaar verplichte leger- of gemeenschapsdienst voor voor alle achttienjarigen. Ook Vlaams minister van Jeugd Sven Gatz is pro. En toeval wil dat wij een jongere kennen die al eens mocht meelopen in het systeem.', '', 'filtered_html'),
('node', 'article', 0, 11, 11, 'und', 0, 'In Vivre sa mort (2014) volgt documentairemaker Manu Bonmariage twee koppels met kinderen waarvan de mannen kanker hebben. In deze moeilijke omstandigheden met het einde voor ogen, twijfelen ze, maar langzamerhand groeit het besef dat euthanasie een mogelijke uitweg kan bieden.', '', 'filtered_html'),
('node', 'article', 0, 12, 12, 'und', 0, 'Het zijn elementaire marktwetmatigheden: de prijs stijgt naarmate de goederen schaarser worden. Dat geldt ook als het om bedreigde diersoorten gaat. Ondertussen wordt er zelfs gespeculeerd op uitstervende dieren. Want als je een lading illegaal ivoor hebt zitten en morgen komt er geen nieuw ivoor meer op de markt, dan heb je winst!\r\n\r\nDe illegale handel in bedreigde diersoorten boomt wereldwijd en is lang niet meer het werk van de gewetenloze eenzame jager. Met name de toegenomen vraag vanuit Azië naar bijvoorbeeld ivoor zorgt ervoor dat de handel erin aanschuift in het rijtje drugs- en wapenhandel. Illegaal, maar bijzonder lucratief.\r\n\r\nPanorama onderzoekt waarom ivoor en het hoorn van de neushoorn zo populair zijn, wie verkoopt en wie koopt. Wie zijn de grote spelers in deze illegale handel en hoe wordt die bestreden?', '', 'filtered_html'),
('node', 'article', 0, 13, 13, 'und', 0, 'Een broeierige zomeravond in een anoniem Kempisch dorp. Yannis, Michael en Brent komen samen op een leeg parkeerterrein. Ze praten, kijken naar voorbijgangers, ze spelen met hun brommers. Ze wachten. Enzo Smits tracht om een gevoel te capteren dat vele adolescente jongeren kennen: ze bevinden zich in een soort van transitzone tussen jong zijn en volwassen worden. Ze wachten op het volwaardige leven en doen dat al ‘hangend’. Enzo Smits maakte daar een trage en poëtische sfeerfilm over. Wie een klassiek portret verwacht, is eraan voor de moeite. De kijker wacht mee met de adolescenten ...\r\n\r\nMet: Yannis Verherstraeten, Michael Verherstraeten en Brent Embrechts | Regie: Enzo Smits | Camera: Grimm Vandekerckhove | Geluid: Kwinten Van Laethem | Sounddesign & Mix: Kwinten Van Laethem | Colorgrading: Xavier Dockx | Montage: Enzo Smits | Met dank aan: Magali Coremans, Nick Geboers, Marc Goyens, Nicolas Karakatsanis, Bas Devos, Moon Blaisse, Jonathan Van Essche, Fien Troch, ...\r\n\r\n', '', 'filtered_html'),
('node', 'article', 0, 14, 14, 'und', 0, 'PROMO PROMO PROMO!\r\n\r\nNieuw! \r\n\r\nTest\r\n\r\ndaaaag!', '', 'filtered_html');
