(8, 'node', ' fifa presenteert qatar 2022 de wereldvoetbalbond fifa is aangeklaagd voor uitbuiting van arbeiders in qatar bij de voorbereidingen van het wk voetbal in 2022 zijn naar schatting al honderden werknemers omgekomen fifa zegt nochtans altijd duidelijk geweest te zijn in de communicatie over het wk 2022 fifa artikels 13oktober canvas ', 0),
(9, 'node', ' de hobbyhoek het strotrammertje brusselaars moeten 100 miljoen euro groenestroomsubsidies betalen voor een vervuilende en verouderde afvalverbrandingsoven dat lijkt louche maar gelukkig is didier van de hobbyhoek er om het volk alles te laten slikken met een leuk strotrammertje diw 13oktober gouhie artikels ', 0),
